import React from "react";
import { Box, Typography } from "@mui/material";
import TaggingKPIs from "./TaggingKPIs";

function Tagging() {
  return (
    <Box>
      <Typography variant="h5" fontWeight={600} mb={2}>Reasons Tagging</Typography>
      <TaggingKPIs />
    </Box>
  );
}

export default Tagging;
